Let's change this to a Golang example: First in the structure.tex file change \lstset{language=c} to \lstset{language=go} Next we will give a simple example of creating a simple recursive fibonnaci program: package main import "fmt" func main() { var fib func(n int) int fib = func(n int) int { if n < 2 { return n } return fib(n-1) + fib(n-2) } fmt.Println(fib(7))
} So remove the C program and add the code in the lstlisting environment, as seen below: % Code Template % MKProjects TexCreate 2021 % MIT & GPLv2 License
\documentclass[11pt, letterpaper]{book}
\input{structure.tex}
\author{Author}
\date{\today}
\title{A Little Golang} \begin{document}
\maketitle
\newpage
\tableofcontents
\newpage
\section{Intro}
% To use listings with code on text, use the following command:
\begin{lstlisting}
package main import "fmt" func main() { var fib func(n int) int fib = func(n int) int { if n < 2 { return n } return fib(n-1) + fib(n-2) } fmt.Println(fib(7))
}
\end{lstlisting}
% To use external code, use the following command:
%\lstinputlisting{file.c}
\end{document} We could also save the code in a file and use \lstuiinputlisting{file.go}

